import Header from "../components/header.js";
import Footer from "../components/Footer.js";

export default function About() {
  return (
    <section class="about-page">
      <Header />
      <div class="content-wrapper w-container"></div>
      <div class="section">
        <h1 class="page-title about-header">About Us</h1>
        <blockquote class="block-quote">
          The beauty isn&#x27;t in any particular type of art,
          <br /> but the use of art to inspire people, <br />
          to balance love, <br />
          wisdom
          <br /> and taste in a way that is so organic <br />
          and global that it becomes a lifestyle
        </blockquote>
      </div>
      <Footer />
      <style jsx>{`
        .about-page {
          height: 100vh;
        }
      `}</style>
    </section>
  );
}
